import React, { Component } from 'react';
import PostHeader from './PostHeader';

export default class PostList extends Component {
  render() {
    return (
        <ul>
        {this.posts.map((post) => { return < PostHeader title={post.title} body={post.body} key={post.id} />})}
      </ul>
    );
  }
}
